import React from 'react';
import {BrowserRouter as Router, Routes, Route, Link} from 'react-router-dom';
import Explore from '../../Pages/Explore';
import Following from '../../Pages/Following';
import MyItems from '../../Pages/MyItems';
import SearchIcon from '../../../src/assets/search.svg';
import CryptoIcon from '../../../src/assets/crypto-ket.svg';
import {Nav, Navbar, InputGroup, Form, Button,Container, Row, Col} from 'react-bootstrap';
import './header.css';

const BasicExample = () => {
  // const [value,setValue]=useState('')
  return (
    <Router>
      <Navbar bg="dark" variant="dark">
        <Container>
          <Row>
            <Col xs={6} md={4}>
              <img src={CryptoIcon} alt="React Logo" />
              <InputGroup className="mb-3">
                <InputGroup.Text id="inputGroup-sizing-default">
                  <img src={SearchIcon} alt="search" />
                </InputGroup.Text>
                <Form.Control
                  placeholder="Search Item Here"
                  aria-label="Default"
                  aria-describedby="inputGroup-sizing-default"
                />
              </InputGroup>
            </Col>
            <Col xs={6} md={4}>
              <Nav defaultActiveKey="/" className="me-auto">
                <Nav.Link as={Link} to={'/'}>Explore</Nav.Link>
                <Nav.Link as={Link} to={'/MyItems'}>MyItems</Nav.Link>
                <Nav.Link as={Link} to={'/Following'}>Following</Nav.Link>
              </Nav>
            </Col>
            <Col xs={6} md={4}>
              <Button className="btn create-button">Create</Button>
              <Button className="btn connect-button" variant="outline">
                Connect
              </Button>
            </Col>
          </Row>
        </Container>
      </Navbar>
      <div>
        <Routes>
          <Route path="/" element={<Explore />} />
          <Route path="MyItems" element={<MyItems />} />
          <Route path="Following" element={<Following />} />
        </Routes>
      </div>
    </Router>
  );
};

export default BasicExample;
